import React from 'react'
import Card from 'react-bootstrap/Card'
import Image from "react-bootstrap/Image";

const Beitrag = (props) => {
    let height;
    return (
        <div>
            <Card className="mb-4">
                <Card.Header>
                    {props.name}
                    <Image className= "center" src= "http://placekitten.com/200/200" height={height}></Image>
                </Card.Header>
                <Image className= "w-50 center" src= "http://placekitten.com/200/200"></Image>
                <Card.Body>
                    {props.text}
                </Card.Body>
            </Card>
           
        </div>
    )
}

export default Beitrag
